package main

import "encoding/base64"

func readPackedFile(path string) []byte {
	if b, ok := packedFiles[path]; !ok {
		return nil
	} else {
		b, err := base64.StdEncoding.DecodeString(b)
		if err != nil {
			panic(err)
		}

		return b
	}
}

var packedFiles = map[string]string{
	"./quotes/en":    "",
	"./quotes/stoic": "",
	"./quotes/long":  "",
	"./words/fi":     "",
	"./words/pt":     "",
	"./words/ru":     "",
	"./words/it":     "",
	"./words/pl":     "",
	"./words/de-ch":  "",
	"./words/fr":     "",
	"./words/es":     "",
	"./words/200en":  "",
	"./words/1000en": "",
	"./words/de":     "",
	"./words/sv":     "",
}
